import { text } from "express";
import React from "react"

export default function Navbar(props) {
    const textStyle = {
        color: props.darkmode ? "white" : "black",
    };
    return(
        <header 
            className="navbar"
            style={textStyle}
        >
            <h1 className="navbar--title">natsukashii</h1>
            <ul className="navbar--items">
                <li>About</li>
                <li>Stories</li>
                <li>Contact</li>
            </ul>
        </header>
    )
}
